import React from 'react';
import Link from 'next/link'


const Navigation = () => {
    return(
        <>
            <ul> 
                <li>
                    <Link href='/'><a>Home</a></Link>
                </li>
                <li>
                    <Link href='/character'><a>Personajes</a></Link>
                </li>
            </ul>
                       
            <style jsx>{`
                ul{
                    width: 100%;
                    height: 3em;
                    display: flex;
                    background: #536FA6;
                    align-items:center;
                }
                li{
                    display: inline-block;
                    margin-left: 3em;
                }
                a{
                    color: #3BD98F;
                    text-decoration: none;
                    font-size: 18px;
                }
                a:hover{
                    color: #38F289;
                    font-weight: bold;
                }
            
            `}</style>
        </>
    )
}
export default Navigation;
